import React from "react";
import { connect } from "react-redux";

export const Malls = () => {
      <div className="menu-h" id="accordion">
        <h> all_malls </h>
      </div>
};

const mapStateToProps = ({ malls }) => ({
  all_malls: malls.all_malls,
});

export default connect(mapStateToProps)(Malls);
